metadata.preview:
    placeholder="110"
    value={patientData.standTest.peakHR || ''}
    onChange={(e) => {
      const peakHR = parseInt(e.target.value) || null
      const baselineHR = patientData.standTest.baselineHR
      const meetsPOTS = peakHR && baselineHR ? (peakHR - baselineHR >= 30) : false

      setPatientData(prev => ({
        ...prev,
        standTest: {
          ...prev.standTest,
          peakHR,
          sustainedHR: peakHR,
          meetsPOTS,
          performed: true
        }
      }))
    }}
  />
</div>
